import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Ensure Bootstrap CSS is imported
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { Slide } from 'react-toastify';
import { Collapse, Button, CardBody, Card } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faChevronDown, faChevronUp } from '@fortawesome/free-solid-svg-icons';

function Hologram() {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
        <div>
           <Card onClick={toggle} style={{ display: 'flex', justifyContent: 'space-between', borderTopLeftRadius: '10px', borderTopRightRadius: '10px', borderBottomLeftRadius: '0px', borderBottomRightRadius: '0px' }}>
    <span>Track Options</span>
    <FontAwesomeIcon icon={isOpen ? faChevronUp : faChevronDown} />
</Card>
            <Collapse isOpen={isOpen}>
                <Card style={{ borderBottomLeftRadius: '10px', borderBottomRightRadius: '10px',  borderTopLeftRadius: '0px', borderTopRightRadius: '0px' }}>
                    <CardBody>
                        <form>
                            {/* Your form fields go here */}
                        </form>
                    </CardBody>
                </Card>
            </Collapse>
        </div>
    );
}

export default Hologram;
